import React from 'react';
// import { Router } from 'express';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import Bins from './bins';
import Products from './product';
import Inventory from './inventory';
import Order from './order';
import OrderLine from './order-lines';

class App extends React.Component {

  render() {

    return(


      <Router>

        <nav className="navbar navbar-expand-lg bg-dark">
            <a className="navbar-brand">Scout Inc. Warehouse</a>

            <Route path='/bins' component={Bins} />
        <Route path='/products' component={Products} />
        <Route path='/orders' component={Order} />
        <Route path='/order-lines' component={OrderLine} />
        <Route path='/inventory' component={Inventory} />


          <div className="collapse nav-collapse">
          <ul class="nav">
    <li><a href="#">About</a></li>
    <li><a href="#">Cupcakes & Prices</a></li>
    <li><a href="#">Locations</a></li>
    <li class="last"><a href="#">Contact Us</a></li>
  </ul>

          </div>

        </nav>

      </Router>

      /* <div>
        <h2>Welcome to Warehouse App</h2>
        <button>Bins</button>
        <button>Products</button>
        <button>Inventory</button>
        <button>Orders</button>
        <button>Order Lines</button>
        <hr></hr>
        <Bins></Bins>
        <hr></hr>
        <Products></Products>
        <hr></hr>
        <Inventory></Inventory>
        <hr></hr>
        <Order></Order>
        <hr></hr>
        <OrderLine></OrderLine>
        <hr></hr>
      </div>  */

    );
  }
}

export default App;
